(window.webpackJsonp=window.webpackJsonp||[]).push([[13],{368:function(e,n,a){"use strict";a.r(n);var t=a(42),r=Object(t.a)({},(function(){var e=this,n=e.$createElement,a=e._self._c||n;return a("ContentSlotsDistributor",{attrs:{"slot-key":e.$parent.slotKey}},[a("h1",{attrs:{id:"iphone-app"}},[a("a",{staticClass:"header-anchor",attrs:{href:"#iphone-app"}},[e._v("#")]),e._v(" iPhone App")]),e._v(" "),a("p",[e._v("Na ons onderzoek naar RFID en NFC was het tijd om de tags uit te testen\nEerst hebben apps voor op de iphone gebruikt. Deze waren heel gebruiksvriendelijk. We konden gemakkelijk een tag lezen.\nHiermee konden we ook gemakkelijk verschillende zaken zoals bv tekst, url, gsm nummer naar een tag schrijven.\nMaar niet alle tags werkten met de applicatie. Dit kan liggen aan het feit dat de app voor nfc tags is en de andere mss RFID tags zijn → dit staat niet op de tag.")]),e._v(" "),a("h2",{attrs:{id:"windows-reader"}},[a("a",{staticClass:"header-anchor",attrs:{href:"#windows-reader"}},[e._v("#")]),e._v(" Windows reader")]),e._v(" "),a("p",[e._v("Daarna hebben we allebei ook de reader aangesloten op windows laptop, aangezien deze enkel werkt met windows.\nBij het aansluiten van de reader werd er automatisch een software gedownload om de reader in werking te stellen.\nOm te checken of de reader werkte hebben we via notities de tags proberen lezen → bij het lezen van de kaart kwam er een id tevoorschijn, dit kan je zien op de bovenste foto.\nDe andere tags werken niet → kan ook zijn omdat het geen RFID is of omdat de tag niet werkt.")]),e._v(" "),a("h2",{attrs:{id:"gui-software-voor-de-windows-reader"}},[a("a",{staticClass:"header-anchor",attrs:{href:"#gui-software-voor-de-windows-reader"}},[e._v("#")]),e._v(" GUI-software voor de Windows-reader")]),e._v(" "),a("p",[e._v("Nu we hebben vastgesteld dat de reader werkte zijn we opzoek gegaan naar de bijbehorende software voor deze reader. Als je op de sites kijkt waar deze worden aangeboden kan je zien dat het voornamelijk wordt gebruikt met IDRW en IDRW-3. Deze bijde varianten hebben we dan gedownload. Jammer genoeg konden we geen van beide varianten aan de praat krijgen. Noch voor het lezen noch bij het schrijven. Het apparaatje piept als hij in contact komt met een tag maar dit gebeurde niet.")]),e._v(" "),a("h2",{attrs:{id:"alternatieve-scripts"}},[a("a",{staticClass:"header-anchor",attrs:{href:"#alternatieve-scripts"}},[e._v("#")]),e._v(" Alternatieve scripts")]),e._v(" "),a("p",[e._v("Gezien alle software die we online kunnen vinden niet werkte met de lezer, noch voor het lezen, noch voor het schrijven. Zijn we opzoek gegaan naar een alternatief. Dit leidde ons naar een Github repo van een gebruiker die alle Windows software had omgezet naar een Python Script om het zo werkend te krijgen. Nu ik er zo op terugkijk hadden we kunnen zien aankomen dat het niet ging werken gezien de software waarop het gebaseerd was niet functioneerde maar toch. De software herkent de lezer wel maar gaf ons nooit het gewenste respons")]),e._v(" "),a("h2",{attrs:{id:"a-new-hope"}},[a("a",{staticClass:"header-anchor",attrs:{href:"#a-new-hope"}},[e._v("#")]),e._v(" A New Hope")]),e._v(" "),a("p",[e._v("Vorige week kregen we dan een NFC-lezer voor de Raspberry PI. Aangezien al onze vorige opzoekingen niet werkten, zijn we beginnen zoeken naar documentatie hierover, hopende dat we hiermee wel iets zouden kunnen schrijven naar de nfc tags.")]),e._v(" "),a("h2",{attrs:{id:"bijhorende-software"}},[a("a",{staticClass:"header-anchor",attrs:{href:"#bijhorende-software"}},[e._v("#")]),e._v(" Bijhorende software")]),e._v(" "),a("p",[e._v("Als eerste hebben we een software van nxp geïnstalleerd op onze Raspberry Pi. Bij het installeren kregen we geen errors dus we dachten dat het deze keer wel ging werken. Maar in onze terminal bleef er staan “waiting for tag or device…” ook al legden we er verschillende tags op.")]),e._v(" "),a("h2",{attrs:{id:"alternatieve-scripts-2"}},[a("a",{staticClass:"header-anchor",attrs:{href:"#alternatieve-scripts-2"}},[e._v("#")]),e._v(" Alternatieve scripts")]),e._v(" "),a("p",[e._v("Gezien de meegeleverde software niet werkte zijn we beginnen kijken naar alternatieven. Zo zijn we terecht gekomen op de Github van een zeker Tom. Deze stelde een soort schil rond de originele software beschikbaar. Geschreven in python zodat het gemakkelijk te gebruiken is met een Raspberry. Jammer genoeg hebben we die ook niet werkend gekregen. Het is lastig om het precieze probleem te lokaliseren gezien je moeilijk kunt nagaan of de randapparatuur werkt of juist is aangesloten, er is geen lichtje dat brand of geluidje die afspeeld. Ook kregen we geen errors te zien in onze terminal, dus zo konden we het probleem ook niet detecteren.")]),e._v(" "),a("h2",{attrs:{id:"conclusie"}},[a("a",{staticClass:"header-anchor",attrs:{href:"#conclusie"}},[e._v("#")]),e._v(" Conclusie")]),e._v(" "),a("p",[e._v("Jammer genoeg hebben we dus niets kunnen schrijven naar de tags. We hebben heel wat verschillende zaken geprobeerd. Vooral bij de laatste mogelijkheden was het moeilijk om te achterhalen waar het probleem zit. We konden niet nagaan of de tags werkten, welke soort tag het was, welke versie,... Bij de raspberry Pi kregen we zoals we daarnet vertelden ook niet veel output, waardoor we niet verder konden onderzoeken waar het probleem precies ligt.")])])}),[],!1,null,null,null);n.default=r.exports}}]);